import React from "react";

const ShowTodoList = ({ todos }) => {
  console.log("Tareas en ShowTodoList:", todos); // Verificar que se reciben

  return (
    <div>
      <h2>Lista de Tareas</h2>
      {todos && todos.length > 0 ? (
        <ul>
          {todos.map((todo) => (
            <li key={todo._id}>
              <h3>{todo.title}</h3>
              <p>{todo.description}</p>
              <p>Fecha: {new Date(todo.date).toLocaleDateString()}</p>
              <p>Prioridad: {todo.priority}</p>
              <p>Estado: {todo.done ? "Completada" : "Pendiente"}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>No hay tareas disponibles</p>
      )}
    </div>
  );
};

export default ShowTodoList;
